double GLAST_slew_estimate ( double ra_s, double dec_s, // sun coordinates (radians)
			     double ra_i, double dec_i, // initial pointing
			     double ra_f, double dec_f // final pointing
			     )
{
 double duration;
 double xz_slew_angle, y_slew_angle;

#ifdef DEBUG
 printf ("    Sun RA and dec: %f  %f \n", ra_s, dec_s);
 printf ("Initial RA and dec: %f  %f \n", ra_i, dec_i);
 printf ("  Final RA and dec: %f  %f \n", ra_f, dec_f);
#endif

 VaryingEigAxisSlewAngleEst(ra_s, dec_s, ra_i, dec_i, ra_f, dec_f, &xz_slew_angle, &y_slew_angle);

#ifdef DEBUG
 double pi = M_PI;
 printf ("xz_slew_angle %f degrees, y_slew_angle %f degrees\n", xz_slew_angle*180.0/pi, y_slew_angle*180.0/pi);
#endif

 //printf("y_slew_angle %f, xz_slew_angle %f, total_time %f, theta_y_mesh %f, theta_xz_mesh %f \n ",y_slew_angle, xz_slew_angle, total_time, theta_y_mesh, theta_xz_mesh);
 

 duration = interp_Angle2Time(y_slew_angle, xz_slew_angle, total_time, theta_y_mesh, theta_xz_mesh);

#ifdef DEBUG
 printf ("Duration = %f\n", duration);
#endif

 return duration;
}


/* Multiply a 3x3 matrix by a 3 element vector, yielding a 3 element vector */
void MultMatVec (AtRotMat m, AtVect v, AtVect result)
{
  result[0] = m[0][0] * v[0] + m[0][1] * v[1] + m[0][2] * v[2];
  result[1] = m[1][0] * v[0] + m[1][1] * v[1] + m[1][2] * v[2];
  result[2] = m[2][0] * v[0] + m[2][1] * v[1] + m[2][2] * v[2];
}

/* Multiply a 3x3 matrix by a scalar value, yielding a 3x3 matrix */
void MultRM (AtRotMat m, double a, AtRotMat result)
{
  int i, j;
  for (i = 0; i < 3; i++)
    {
      for (j = 0; j < 3; j++)
	{
	  result[i][j] = a * m[i][j];
	}
    }
}

/*
%% [eig_axis, aor, aor_body, slew_angles] = VaryingEigAxisSlewAngleEst
%%                                  (ra_s, dec_s, ra_i, dec_i, ra_f, dec_f)
%% Function:
%%  This function estimates the total slew angles of the GLAST spacecraft
%%  from one inertial target (initial) to the next (final). The strategy
%%  here is to break down the slew into two segments 1) A rotation about
%%  the sun vector till the body pitch axis reaches the final orientation, 
%%  2) A pitch axis slew till the attitude of the spacecraft matches with 
%%  the final desired attitude.
%% Assumptions:
%%  1) Sun vector is in the body +x-z plane at the initial attitude
%%  2) Sun vector is in the body +x-z plane at the final attitude
%%
%% INPUTS
%%               ra:  Right Ascension [rad], angle from the +X axis
%%              dec:  Declination [rad], elevation angle from the X-Y plane
%%                s:  Sun vector
%%                i:  Initial direction of the GLAST +Z axis
%%                f:  Final/target direction of the GLAST +Z axis
%% OUTPUTS
%%      slew_angles:  [Slew Angle about body XZ, Y]
%%         eig_axis:  Axis of rotation for the two rotations
%%              aor:  Angle of rotation for the two rotations
%%         aor_body:  Angle of slew in the body frame
%%      slew_angles:  Sum of aor_body
*/
void  VaryingEigAxisSlewAngleEst(double ra_s, double dec_s,
				 double ra_i, double dec_i, 
				 double ra_f, double dec_f, 
				 double *xz_slew_angle, double *y_slew_angle)
{

  AtVect r_s;
  AtVect r_z_i;
  AtVect r_z_f;
  AtVect r_y_i;   // Normalized cross product of initial target and sun
  AtVect r_y_f;   // Normalized cross product of final target and sun
  AtVect r_x_i;
  AtVect r_x_f;
  AtVect cross_z_i_s;
  AtVect cross_z_f_s;
  AtVect cross_y_z_i;
  AtVect cross_y_z_f;

  double tmpV1, tmpV2;
  tmpV1 = cos(dec_s);
  tmpV2 = cos(ra_s);
  r_s[0] = tmpV1*tmpV2;

  r_s[1] = cos(dec_s)*sin(ra_s);
  r_s[2] = sin(dec_s);

  /* r_z_i = [cos(dec_i)*cos(ra_i),cos(dec_i)*sin(ra_i),sin(dec_i)]; */
  r_z_i[0] = cos(dec_i)*cos(ra_i);
  r_z_i[1] = cos(dec_i)*sin(ra_i);
  r_z_i[2] = sin(dec_i);

  /* r_y_i = cross(r_z_i, r_s)/norm(cross(r_z_i, r_s)); */
  atVectProd( r_z_i, r_s, cross_z_i_s); // cross product of r_z_i and r_s 
  atNormVect(cross_z_i_s, r_y_i);       // Normalized vector


  /* r_x_i = cross(r_y_i, r_z_i)/norm(cross(r_y_i, r_z_i)); */
  atVectProd (r_y_i, r_z_i, cross_y_z_i);
  atNormVect (cross_y_z_i, r_x_i);


  /* r_z_f = [cos(dec_f)*cos(ra_f),cos(dec_f)*sin(ra_f),sin(dec_f)]; */
  r_z_f[0] = cos(dec_f)*cos(ra_f);
  r_z_f[1] = cos(dec_f)*sin(ra_f);
  r_z_f[2] = sin(dec_f);


  /* r_y_f = cross(r_z_f, r_s)/norm(cross(r_z_f, r_s)); */
  atVectProd (r_z_f, r_s, cross_z_f_s);
  atNormVect (cross_z_f_s, r_y_f);


  /* r_x_f = cross(r_y_f, r_z_f)/norm(cross(r_y_f, r_z_f)); */
  atVectProd (r_y_f, r_z_f, cross_y_z_f);
  atNormVect ( cross_y_z_f, r_x_f);

  AtVect AXIS1;
  double dot_product;
  double THETA1;
  /* AXIS1 = r_s; */
  AXIS1[0] = r_s[0];  AXIS1[1] = r_s[1];  AXIS1[2] = r_s[2];


  /* THETA1 = acos(dot(r_y_i,r_y_f)); */
  dot_product = atScalProd(r_y_i,r_y_f);
  if(fabs(dot_product- 1.0) < 1.0E-8){
    THETA1 = 0.0;
  } else if (fabs(dot_product+1.0) < 1.0E-8){
    THETA1 = lpi;
  } else {
    THETA1 = acos(dot_product);
  }


  //  Make a matrix out of the vectors

  /*
xyz_i = [(r_x_i);
         (r_y_i);
         (r_z_i)];
  */
  AtRotMat xyz_i;   // Initial target
  xyz_i[0][0] = r_x_i[0];
  xyz_i[0][1] = r_x_i[1];
  xyz_i[0][2] = r_x_i[2];

  xyz_i[1][0] = r_y_i[0];
  xyz_i[1][1] = r_y_i[1];
  xyz_i[1][2] = r_y_i[2];

  xyz_i[2][0] = r_z_i[0];
  xyz_i[2][1] = r_z_i[1];
  xyz_i[2][2] = r_z_i[2];

  AtVect tmp_stp1;
  double tmp_stp2;  // Dot Product of tmp_stp1
  AtVect cross_stp1;

  /* tmp_stp1 = (cross(r_y_i, r_y_f)) / norm((cross(r_y_i, r_y_f))); */
  atVectProd(r_y_i, r_y_f, cross_stp1);
  atNormVect(cross_stp1, tmp_stp1);
  
  /* tmp_stp2 = dot(AXIS1,tmp_stp1); */
  tmp_stp2 = atScalProd(AXIS1, tmp_stp1);



  /*  if((tmp_stp2)<0)
        AXIS1 = -AXIS1;
      end
  */
 if (tmp_stp2 < 0.0)
   {
     // If the dot product is negative
     // Negate each element of the vector?
     AXIS1[0] = -AXIS1[0];
     AXIS1[1] = -AXIS1[1];
     AXIS1[2] = -AXIS1[2];
   }

  AtRotMat tilde1;

  /* tilde1 = [0, -AXIS1(3), AXIS1(2);
     AXIS1(3), 0, -AXIS1(1);
    -AXIS1(2), AXIS1(1), 0];
  */

  tilde1 [0][0] =  0.0;       tilde1 [0][1] = -AXIS1[2];  tilde1 [0][2] =  AXIS1[1];
  tilde1 [1][0] =  AXIS1[2];  tilde1 [1][1] =  0.0;       tilde1 [1][2] = -AXIS1[0];
  tilde1 [2][0] = -AXIS1[1];  tilde1 [2][1] =  AXIS1[0];  tilde1 [2][2] =  0.0;

  AtRotMat mRi;
  AtRotMat eye;
  eye [0][0] = 1.0; eye[0][1] = 0.0; eye [0][2] = 0.0;
  eye [1][0] = 0.0; eye[1][1] = 1.0; eye [1][2] = 0.0;
  eye [2][0] = 0.0; eye[2][1] = 0.0; eye [2][2] = 1.0;

  /* mRi = eye(3) + sin(THETA1)*tilde1 + (1-cos(THETA1))*(tilde1)^2; */

  AtRotMat sin_th_tilde;  // There probably is an intelligent name for this
  AtRotMat cos_th_tilde;  // There probably is an intelligent name for this
  AtRotMat square_tilde;  // There probably is an intelligent name for this

  double sin_th;
  double one_minus_cos_th;

  int i, j;
  sin_th = sin(THETA1);
  one_minus_cos_th = 1.0 - cos(THETA1);

  MultRM (tilde1, sin_th, sin_th_tilde);

  atRMProd(tilde1, tilde1, square_tilde);  // (tilde1)^2

  MultRM (square_tilde, one_minus_cos_th, cos_th_tilde);

  // Matrix addition

  for (i = 0; i < 3; i++)
    for (j = 0; j < 3; j++)
      mRi[i][j] = eye[i][j] + sin_th_tilde[i][j] + cos_th_tilde[i][j];


  /* r_x_m = mRi*r_x_i'; */
  // multiply matrix with Transpose of r_x_i vector (3x1) to yield a vector (3X1)
  // 3 rows, 1 column
  AtVect r_x_m;
  MultMatVec (mRi, r_x_i, r_x_m);

  /* r_y_m = mRi*r_y_i'; */
  AtVect r_y_m;
  MultMatVec (mRi, r_y_i, r_y_m);

  /* r_z_m = mRi*r_z_i'; */
  AtVect r_z_m;
  MultMatVec (mRi, r_z_i, r_z_m);

  //  Assemble the resulting vectors back into a matrix
  /*
    xyz_m = [(r_x_m)';
             (r_y_m)';
             (r_z_m)'];
  */
  AtRotMat xyz_m; // 3x3 matrix

  xyz_m[0][0] = r_x_m[0];  xyz_m[0][1] = r_x_m[1];  xyz_m[0][2] = r_x_m[2];
  xyz_m[1][0] = r_y_m[0];  xyz_m[1][1] = r_y_m[1];  xyz_m[1][2] = r_y_m[2];
  xyz_m[2][0] = r_z_m[0];  xyz_m[2][1] = r_z_m[1];  xyz_m[2][2] = r_z_m[2];

  AtVect AXIS2;
  double THETA2;
  AtRotMat tilde2;

  /* THETA2 = acos(dot(r_x_m,r_x_f)); */
  dot_product = atScalProd(r_x_m,r_x_f);
 
  THETA2 = acos(std::min(std::max(dot_product,-1.0),1.0));
 
  /* AXIS2 = r_y_f; */
  AXIS2[0] = r_y_f[0];  AXIS2[1] = r_y_f[1];  AXIS2[2] = r_y_f[2];


  /* tmp_stp1 = (cross(r_x_m, r_x_f)) / norm((cross(r_x_m, r_x_f))); */
  atVectProd(r_x_m, r_x_f, cross_stp1);
  atNormVect(cross_stp1, tmp_stp1);

  /* tmp_stp2 = dot(AXIS2,tmp_stp1); */
  tmp_stp2 = atScalProd(AXIS2, tmp_stp1);

  /*
   * if((tmp_stp2)<0)
   *    AXIS2 = -AXIS2;
   * end
   */
 if (tmp_stp2 < 0.0)
   {
     // If the dot product is negative
     // Negate each element of the vector?
     AXIS2[0] = -AXIS2[0];
     AXIS2[1] = -AXIS2[1];
     AXIS2[2] = -AXIS2[2];
   }

/* tilde2 = [0, -AXIS2(3), AXIS2(2); */
/*     AXIS2(3), 0, -AXIS2(1); */
/*     -AXIS2(2), AXIS2(1), 0]; */
  tilde2 [0][0] =  0.0;       tilde2 [0][1] = -AXIS2[2];  tilde2 [0][2] =  AXIS2[1];
  tilde2 [1][0] =  AXIS2[2];  tilde2 [1][1] =  0.0;       tilde2 [1][2] = -AXIS2[0];
  tilde2 [2][0] = -AXIS2[1];  tilde2 [2][1] =  AXIS2[0];  tilde2 [2][2] =  0.0;

  AtRotMat fRm;

  /* fRm = eye(3) + sin(THETA2)*tilde2 + (1-cos(THETA2))*(tilde2)^2; */
  sin_th = sin(THETA2);
  one_minus_cos_th = 1.0 - cos(THETA2);
  
  MultRM(tilde2, sin_th, sin_th_tilde);
  
  atRMProd(tilde2, tilde2, square_tilde);

  MultRM(square_tilde, one_minus_cos_th, cos_th_tilde);

  // Matrix addition

  for (i = 0; i < 3; i++)
    for (j = 0; j < 3; j++)
      fRm[i][j] = eye[i][j] + sin_th_tilde[i][j] + cos_th_tilde[i][j];

  AtVect THETA1_BODY;
  AtVect THETA2_BODY;

  AtVect term1;   // Need good variable names
  AtVect term2;

  /* THETA1_BODY = THETA1.*xyz_i*AXIS1'; */
  // Assume matrix * has precedence,  THETA1 *(xyz_i*AXIS1')
  MultMatVec(xyz_i, AXIS1, term1);
  atMultVect(THETA1, term1, THETA1_BODY);

  /* THETA2_BODY = THETA2.*xyz_m*AXIS2'; */
  MultMatVec(xyz_m, AXIS2, term2);
  atMultVect(THETA2, term2, THETA2_BODY);

/* % optional outputs */
/* % eig_axis = [AXIS1;AXIS2]; % optional output */
/* % aor = [THETA1;THETA2]; */
/* % aor_body = [THETA1_BODY';THETA2_BODY']; */

  /* slew_angles = [norm(THETA1_BODY'),norm(THETA2_BODY')] */
  
  *xz_slew_angle = atNorm(THETA1_BODY);
  *y_slew_angle = atNorm(THETA2_BODY);

  }



/* function duration = interp_Angle2Time(input_x, input_y, mesh_data, mesh_x, mesh_y) */
/* % */
/* %   Inputs: */
/* %   input_x:   desirable data point on the x grid*/
/* %   input_y:   desirable data point on the y grid*/
/* %   mesh_data: [a x b] matrix of data, where 'a' corresponds to the length of */
/* %              the available data corresponding to input_y, and 'b' */
/* %              corresponds to the length of the available data */
/* %              corresponding to input_x; */
/* %   mesh_x:    [a x b] matrix of x-axis grid for interpretating the */
/* %              mesh_data. */
/* %   mesh_y:    [a x b] matrix of y-axis grid for interpretating the */
/* %              mesh_data. */
/* %   Outputs: */
/* %       slew */
/* %   duration:  the corresponding slew maneuver duration for input_x, and         */
/* %              input_y based on the mesh_data (interpolate when it's necessary). */
// input_x ~= y_slew_angle
// input_y ~= xz_slew_angle
// total_time ~= mesh_data
// mesh_x ~= theta_y_mesh
// mesh_y ~= theta_xz_mesh

double interp_Angle2Time(double input_x, double input_y,
			 double mesh_data[end+1][end+1], double mesh_x[end+1][end+1], double mesh_y[end+1][end+1])
{
  double duration = 0.0;

#ifdef DEBUG
  printf ("interp_Angle2Time: y_slew_angle=%f xz_slew_angle = %f\n",
	  input_x,  input_y);
#endif

  /*% Check the boundary first, make sure the data is within the mesh_data grid*/

  /* if((input_x < mesh_x(1,1)) || (input_x > mesh_x(1,end)))
       fprintf('Input_x is out of bound, it need to be between %7.5f and %7.5f\n', mesh_x(1,1), mesh_x(1,end));
       return;
     elseif ((input_y < mesh_y(1,1)) || (input_y > mesh_y(end,1)))
       fprintf('Input_y is out of bound, it need to be between %7.5f and %7.5f\n', mesh_y(1,1), mesh_y(end,1));
       return;
     end
  */ 
  if((input_x < mesh_x[0][0]) || (input_x > mesh_x[0][end]))
    {
      fprintf(stderr, "Input_x is out of bound, it need to be between %7.5f and %7.5f\n",
	      mesh_x[0][0], mesh_x[0][end]);
      return 0.0;
    }
  else if ((input_y < mesh_y[0][0]) || (input_y > mesh_y[end][0]))
    {
      fprintf(stderr, "Input_y is out of bound, it need to be between %7.5f and %7.5f\n", 
	      mesh_y[0][0], mesh_y[end][0]);
      return 0.0;
    }
  
  /* x_increment = mesh_x(1,2) - mesh_x(1,1); % find the x increment, constant increment is assumed */

  double x_increment = mesh_x[0][1] - mesh_x[0][0];

  

  /* x_minus = floor(input_x/x_increment)+1; % round down to obtain the x- index */
  /* x_plus = ceil(input_x/x_increment)+1; % round up to obtain the x+ index */
  // Don't need to increment the index since C index range starts at 0
   
  double index = input_x/x_increment;
  //printf("HERE index %f  input_x %f x_incremnt %f\n", index, input_x, x_increment);

  int x_minus = (index >= 0.0) ? (int)index : (int)(index - 1.0);
  int x_plus =  (index > 0.0) ? (int)(index + 1.0) : (int) (index);


  /* kx = (input_x - mesh_x(1, x_minus))/ x_increment; % weighting along the x-axis */
  double kx = (input_x - mesh_x[0][x_minus])/ x_increment;



  /* y_increment = mesh_y(2,1) - mesh_y(1,1); % find the y increment, constant increment is assumed */
  double y_increment = mesh_y[1][0] - mesh_y[0][0]; 
  

  

  /* y_minus = floor(input_y/y_increment)+1; % round down to obtain the y- index */
  /* y_plus = ceil(input_y/y_increment)+1; % round up to obtain the y+ index */
  index = input_y/y_increment;
  int y_minus = index >= 0.0 ? (int)index : (int)(index - 1.0);
  int y_plus = index >= 0.0 ? (int)(index + 1.0) : (int)index ;


  //printf("mesh_y[%i][0] %f and y_increment %f\n ---- \n",y_minus,mesh_y[y_minus][0], y_increment );
  
  /* ky = (input_y - mesh_y(y_minus, 1))/ y_increment; % % weighting along the y-axis */
  double ky = (input_y - mesh_y[y_minus][0])/ y_increment;

  /*
    a = mesh_data(y_minus, x_minus);
    b = mesh_data(y_minus, x_plus);
    c = mesh_data(y_plus, x_minus);
    d = mesh_data(y_plus, x_plus);
  */

  double a = mesh_data[y_minus][x_minus];
  double b = mesh_data[y_minus][x_plus];
  double c = mesh_data[y_plus][x_minus];
  double d = mesh_data[y_plus][x_plus];

  duration = (a+kx*(b-a)) + ky*((c+kx*(d-c)) - (a+kx*(b-a)));
  
  return duration;
}

